import React from "react";
import Gallery from 'react-photo-gallery'
import photo1 from "../assets/photo1.jpg";
import photo2 from "../assets/photo2.jpg";
import photo3 from "../assets/photo3.jpg";
import photo4 from "../assets/photo4.jpg";
import "./MainPagePhotos.css";

const photos = [
  {
    src: "https://images89.fotosik.pl/533/84e713a2c5ea7589.jpg",
    width: 4,
    height: 3,
  },
  {
    src: "https://images92.fotosik.pl/534/2330bbb7ae3fc6a0.jpg",
    width: 1,
    height: 1,
  },
  {
    src: "https://images89.fotosik.pl/533/7a299dde7a1ebdc7.jpg",
    width: 4,
    height: 3,
  },
  {
    src: "https://images90.fotosik.pl/532/50b2126e7e0d4344.jpg",
    width: 4,
    height: 3,
  },
];
function MainPagePhotos() {
  return (
    <div className="photoContainer">
      <div className="grid">
        <img src={photo1} alt='' className="img__photo1" />
      </div>
      <div className="grid">
        <img src={photo2} alt='' className="img__photo2" />
      </div>
      <div className="grid">
        <img src={photo3} alt='' className="img__photo3" />
      </div>
      <div className="grid"></div>
      <div className="grid">
        <img src={photo4} alt='' className="img__photo4" />
      </div>
      <div className="grid">6</div>
    </div>
  );
}

export default MainPagePhotos;
